        private Dictionary<EmailType, EmailTemplate> _emailTemplateToTypeMapping = new Dictionary<EmailType, EmailTemplate>()
        {
            { EmailType.RegistrationSuccess, new EmailTemplate("Потвърждаване на регистрация в Eclipse Market", "<!DOCTYPE html> <html lang=\"en\"> <head> <meta charset=\"UTF-8\" /> <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\" /> <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" /> <script defer></script> <style> * { box-sizing: border-box; padding: 0px; margin: 0px; color: #eeedf0; font-family: \"Rubik\", sans-serif; } .container { padding-top: 24px; width: 100%; height: 100vh; display: flex; flex-direction: column; justify-content: center; align-items: center; background-color: #0d1d35; } .heading { display: flex; justify-content: center; align-items: center; height: 40%; font-size: 2rem; } .heading span { border-bottom: 2px solid transparent; transition: 0.3s; } .heading span:hover { border-bottom: 2px solid #93c5fd; } .verifyBtn { height: 30%; } .verifyBtn button { padding: 32px; border-radius: 12px; background-color: #040d19; border: 2px solid #0b213f; transition: 0.3s; } .verifyBtn button:hover { border-color: #93c5fd; } button span { font-size: 3rem; } footer { height: 40%; display: flex; justify-content: center; align-items: center; font-size: 2rem; } .greeting { font-size: 1.7rem; } .logo { display: flex; justify-content: center; align-items: center; } .logo img { width: 30%; } </style> </head> <body> <div class=\"container\"> <div class=\"logo\"> <img src=\"data:image/png;base64,\" alt=\"\" /> </div> <div class=\"heading\"> <span> Моля потвърдете вашият имейл за да завършите регистрацията си в Eclipse Market </span> </div> <div class=\"verifyBtn\"> <button> <span>Потвърди имейл</span> </button> </div> <footer> <span class=\"greeting\"> Приятно търгуване, <br /> Екипът на Eclipse Market </span> </footer> </div> </body> </html>") },
            { EmailType.ChangePassword,  new EmailTemplate("", "") }
        };


        private async Task Send(string receiverAddress, string subject, string body)
        {
            string senderAddress = _configuration["Email:Address"];
            string senderPassword = _configuration["Email:Password"];

            MailMessage message = new MailMessage();
            message.From = new MailAddress(senderAddress);
            message.Subject = subject;
            message.To.Add(new MailAddress(receiverAddress));
            message.Body = body;
            message.IsBodyHtml = true;

            var smtpClient = new SmtpClient("smtp.gmail.com")
            {
                Port = 587,
                Credentials = new NetworkCredential(senderAddress, senderPassword),
                EnableSsl = true
            };

            await smtpClient.SendMailAsync(message);
        }

        private class EmailTemplate
        {
            public string Subject { get; set; }
            public string Body { get; set; }
            public EmailTemplate(string subject, string body)
            {
                Subject = subject;
                Body = body;
            }
        }

    }
}
